let baseUrl = {
    url: "https://jsonplaceholder.typicode.com/"
}
export const get = (endpoint) => {
    try {
        fetch(baseUrl.url + endpoint)
            .then((res) => {
                console.log(res, 'JSON')
                return res.data
            })
            .catch((err) => {
                return err
            })
    } catch (err) {
        console.error(err)
    }
}
